(6, 1, 'ar', 'الرئيسية', 'الرئيسية', 'بسم الله الرحمن الرحيم &nbsp; dwd', '', '', 1, '', 'front.index', NULL, 'public\\pages/6_8480465-e665-4241-a0dc-11f9eef5f777.png__616de0b8759fc_.png', NULL, '154.179.37.241', 1, '2020-12-08 03:21:50', '2021-12-13 22:33:55', 1),
(7, 1, 'en', 'Home', 'home', 'At XFactor sports Center, we believe everyone&#39;s journey is personal and different. Learning at your own pace is your right and our approach.&nbsp; While we will encourage you, motivate you and push you to do better with yourself&mdash; it&#39;s up to you how quick you want to progress.', '', '', 1, '', 'front.index', NULL, 'public\\pages/7__8480465-e665-4241-a0dc-11f9eef5f777.png__616de0b8__61b7a8d89f046_.png', NULL, '154.179.37.241', 1, '2020-12-08 03:37:12', '2021-12-13 22:32:33', 1),
(8, 2, 'ar', 'عن الموقع', 'عن-الموقع', 'عن الموقع&nbsp;عن الموقع&nbsp;عن الموقع&nbsp;عن الموقع&nbsp;عن الموقع', '', '', 1, 'template_01', 'front.info.show', '{\"alias\":\"**\"}', NULL, '-1635540851.mp4', '196.157.41.81', 1, '2020-12-08 03:57:35', '2021-10-18 22:10:05', 1),
(9, 2, 'en', 'about us', 'about-us', 'XFactor Sports Center is a premier Martial Arts organization based in Doha that provides opportunities to gain access to professional Karate and Kickboxing training classes in a safe, friendly, exciting and enjoyable environment.&nbsp; &nbsp; We strive to ensure peak fitness and excellence in the martial arts that we provide and our team of highly qualified instructors will work with you to help you achieve your personal goals, from increasing your fitness through to getting you ready for competition fighting.&nbsp; &nbsp; Our classes are designed for anyone above the age of 4 years, male or female and for all levels of expertise. Our male and female coaches have over 10 years of Martial Arts experience both in Qatar and internationally. &nbsp; With separate classes for different age groups running throughout the week, we ensure that our teaching is provided at all appropriate levels. &nbsp; At XFactor sports Center, we believe everyone&#39;s journey is personal and different. Learning', '', '', 1, 'template_01', 'front.info.show', '{\"alias\":\"**\"}', 'public\\pages/9_mg-20211210-wa0003.jpg__61bf3c711a185_.jpg', NULL, '154.179.62.195', 1, '2020-12-08 03:57:55', '2021-12-21 15:32:39', 1),
