INSERT INTO `sports_translations` (`id`, `locale`, `sport_id`, `name_translat`, `heading`, `description`, `created_at`, `updated_at`) VALUES
(1, 'en', 1, 'KARATE', 'KARATE SHOTOKAN', 'o	Shotokan is a style of karate, developed from various martial arts by Gichin Funakoshi and his son Gigo (Yoshitaka) Funakoshi. Gichin was born in Shuri, Okinawa, and is widely credited with popularizing karate through a series of public demonstrations, and by promoting the development of university karate clubs, including those at Keio, Waseda, Hitotsubashi (Shodai), Takushoku, Chuo, Gakushuin, and Hosei.\r\no	As a boy, he was trained by two famous masters of that time. Each trained him in a different Okinawan martial art. From Yasutsune Azato he learned Shuri-te. From Yasutsune Itosu, he learned Naha-te. It would be the melding of these two styles that would one day become Shotokan karate.\r\no	Funakoshi had many students at the university clubs and outside dojos, who continued to teach karate after his death in 1957. However, internal disagreements (in particular the notion that competition is contrary to the essence of karate) led to the creation of different organizations—including an initial split between the Japan Karate Association (headed by Masatoshi Nakayama) and the Shotokai (headed by Motonobu Hironishi and Shigeru Egami), followed by many others—so that today there is no single \"Shotokan school\", although they all bear Funakoshi\'s influence.\r\no	Shotokan was the name of the first official dojo built by Funakoshi, in 1939 at Mejiro, and destroyed in 1945 as a result of an allied bombing. Shoto, meaning \"pine-waves\" (the movement of pine needles when the wind blows through them), was Funakoshi’s pen name, which he used in his poetic and philosophical writings and messages to his students. The Japanese kan means \"house\" or \"hall\". In honor of their sensei, Funakoshi’s students created a sign reading shōtō-kan which was placed above the entrance of the hall where Funakoshi taught. Gichin Funakoshi never gave his style a name, just calling it \"karate\".', NULL, '2021-12-02 11:18:04'),
(3, 'ar', 1, 'كاراتية', 'كاراتية كاراتية كاراتية كاراتية', 'كاراتية', NULL, NULL),
(4, 'en', 2, 'KICKBOXING', 'KICKBOXING', 'Since kickboxing is a broad term, understanding the history can be somewhat difficult. Some of the earliest forms of kickboxing included the various southeast asian martial arts especially muay boran, which developed into modern Muay Thai.\r\n\r\nHowever, in terms of modern competition, it was during the 1950s that a Japanese karateka named Tatsuo Yamada first established an outline of a new sport that combined karate and Muay Thai.\r\n\r\nThis was further explored during the early 1960s, when competitions between karate and Muay Thai began, which allowed for rule modifications to take place. By the middle of the decade the first true kickboxing events were being held in Osaka.\r\n\r\nBy the 1970s and 1980s, the sport had expanded beyond Japan and had reached North America and Europe. It was during this time that many of the most prominent governing bodies were formed.\r\n\r\nIn Japan the sport was widely popular and was regularly broadcast on television before going into a dark period during the 1980s.\r\nIn North America the sport had unclear rules so kickboxing and full contact karate were essentially the same sport.\r\nIn Europe the sport found marginal success but did not thrive until the 1990s.\r\nSince the 1990s the sport has been mostly dominated by the Japanese K-1 promotion, with some competition coming from other promotions and mostly pre-existing governing bodies.\r\n\r\nAlong with the growing popularity in competition, there has been an increased amount of participation and exposure in the mass media, fitness, and self-defense.\r\n\r\nJapan\r\n\r\nTatsuo Yamada (left) and his master Choki Motobu (right), 1926\r\nOn December 20, 1959, a Muay Thai match among Thai fighters was held at Asakusa town hall in Tokyo. Tatsuo Yamada, who established \"Nihon Kempo Karate-do\", was interested in Muay Thai because he wanted to perform karate matches with full-contact rules since practitioners are not allowed to hit each other directly in karate matches. At this time, it was unimaginable to hit each other in karate matches in Japan. He had already announced his plan which was named \"The draft principles of project of establishment of a new sport and its industrialization\" in November 1959, and he proposed the tentative name of \"karate-boxing\" for this new sport.[17] It is still unknown whether Nak Muay was invited by Yamada, but it is clear that Yamada was the only karateka who was really interested in Muay Thai. Yamada invited a champion Nak Muay (and formerly his son Kan Yamada\'s sparring partner), and started studying Muay Thai. At this time, the Thai fighter was taken by Osamu Noguchi who was a promoter of boxing and was also interested in Muay Thai.[10][18] The Thai fighter\'s photo was on the magazine \"The Primer of Nihon Kempo Karate-do, the first number\" which was published by Yamada.\r\n\r\nThere were \"Karate vs. Muay Thai fights\" on February 12, 1963. The three karate fighters from Oyama dojo (kyokushin later) went to the Lumpinee Boxing Stadium in Thailand and fought against three Muay Thai fighters. The three kyokushin karate fighters\' names are Tadashi Nakamura, Kenji Kurosaki and Akio Fujihira (also known as Noboru Osawa). The Muay Thai team were composed of only one authentic Thai fighter.[19] Japan won by 2–1: Tadashi Nakamura and Akio Fujihira both KOed opponents by punch while Kenji Kurosaki, who fought the Thai, was KOed by elbow. The only Japanese loser Kenji Kurosaki was then a kyokushin instructor rather than a contender and temporarily designated as a substitute for the absent chosen fighter. On June of the same year, karateka and future kickboxer Tadashi Sawamura faced against top Thai fighter Samarn Sor Adisorn, in which Sawamura was knocked down 16 times and defeated.[19] Sawamura would use what he learned in that fight to incorporate in the evolving kickboxing tournaments.\r\n\r\nNoguchi studied Muay Thai and developed a combined martial art which Noguchi named kick boxing, which absorbed and adopted more rules than techniques from Muay Thai. The main techniques of kickboxing are still derived from Japanese full contact karate (kyokushin). However, throwing and butting were allowed in the beginning to distinguish it from Muay Thai. This was later repealed. The Kickboxing Association, the first kickboxing sanctioning body, was founded by Osamu Noguchi in 1966 soon after that. Then the first kickboxing event was held in Osaka on April 11, 1966.\r\n\r\nTatsu Yamada died in 1967, but his dojo changed its name to Suginami Gym, and kept sending kickboxers off to support kickboxing.[20]\r\n\r\nKickboxing boomed and became popular in Japan as it began to be broadcast on TV.[21] By 1970, kickboxing was telecast in Japan on three different channels three times weekly. The fight cards regularly included bouts between Japanese (kickboxers) and Thai (Muay Thai) boxers. Tadashi Sawamura was an especially popular early kickboxer. In 1971 the All Japan Kickboxing Association (AJKA) was established and it registered approximately 700 kickboxers. The first AJKA Commissioner was Shintaro Ishihara, the longtime Governor of Tokyo. Champions were in each weight division from fly to middle. Longtime Ilyushiner Noboru Osawa won the AJKA bantamweight title, which he held for years. Raymond Edler, an American university student studying at Sophia University in Tokyo, took up kickboxing and won the AJKC middleweight title in 1972; he was the first non-Thai to be officially ranked in the sport of Thai boxing, when in 1972 Rajadamnern ranked him no. 3 in the Middleweight division. Edler defended the All Japan title several times and abandoned it. Other popular champions were Toshio Fujiwara and Mitsuo Shima. Most notably, Fujiwara was the first non-Thai to win an official Thai boxing title, when he defeated his Thai opponent in 1978 at Rajadamnern Stadium winning the lightweight championship bout.\r\n\r\nBy 1980, due to poor ratings and then infrequent television coverage, the golden-age of kickboxing in Japan was suddenly finished. Kickboxing had not been seen on TV until K-1 was founded in 1993.[citation needed]\r\n\r\nIn 1993, as Kazuyoshi Ishii (founder of Seidokaikan karate) produced K-1 under special kickboxing rules (no elbow and neck wrestling) in 1993, kickboxing became famous again.[22][23] In the mid-1980s to early 1990s, before the first k-1, Kazuyoshi Ishii also partook in the formation of glove karate as an amateur sport in Japan. Glove karate is based on knockdown karate rules, but wearing boxing gloves and allowing punches to the head. In effect, it is oriental rules kickboxing with scoring based on knockdowns and aggression rather than the number of hits. As K-1 grew in popularity, Glove karate for a while became the fastest growing amateur sport in Japan.', '2021-10-27 16:10:57', '2022-06-11 13:54:55'),
