(9, 'en', 15, 'XFactor Sports Center Summer Camp', 'XFactor Sports Center Summer Camp :  The Best Way to Spend Your Summer', 'Location:\r\nCompass International School Doha - Gharaffa Campus\r\n\r\nAge \r\n5 - 12 years\r\n\r\nDate \r\n2nd July till 17th of August 2023\r\nSunday - Thursday \r\n7:30 am - 1:30 pm\r\n\r\nPrice \r\n750 qr per week \r\n\r\nActivities \r\nSwimming\r\nArts and Crafts\r\nGames\r\nMartial Arts (Karate, Kickboxing & Boxing)\r\nFootball \r\nMusic and Dance \r\nOutdoor activities\r\nAnd lots more!\r\n\r\nFollowing the success of our summer camp last year, we are back again!\r\n\r\nAt our summer camp, kids have the chance to make new friends, try new activities, and learn new skills. They can also develop their confidence and self-esteem. The summer camp is staffed by highly experienced and skilled staff, the children will always be safe and supervised.\r\n\r\nFor more information or to register please contact 66889921.\r\nPlaces are limited so please contact us as soon as possible to secure your child\'s place.', '2022-06-11 13:51:23', '2023-07-29 13:44:21'),
(10, 'en', 16, 'BOXING', 'BOXING', 'Boxing is a combat sport in which two people, usually wearing protective gloves and other protective equipment such as hand wraps and mouth guards, throw punches at each other for a predetermined amount of time in a boxing ring.\r\n\r\nAlthough the term \"boxing\" is commonly attributed to \"western boxing\", in which only the fists are involved, boxing has developed in various ways in different geographical areas and cultures. In global terms, boxing is a set of combat sports focused on striking, in which two opponents face each other in a fight using at least their fists, and possibly involving other actions such as kicks, elbow strikes, knee strikes, headbutts, depending on the rules. Some forms of modern sport are western boxing, bare-knuckle boxing, kickboxing, muay-Thai, lethwei, savate, and sanda.[1][2] Boxing techniques have been incorporated into many martial arts, military systems, and other combat sports.\r\n\r\nWhile humans have struggled at hand-to-hand battles since the dawn of human history, the earliest information of fist-fighting sporting competitions set back to the past Near Asia in the third and 2nd millennia BC. The earliest indication of boxing principles set back to Ancient Greece, where boxing was instituted as The Olympic play in 688 BC. Boxing developed from 16th- and 18th-century prizefights, mostly in the United Kingdom, to the precursor of modern-day boxing in the mid-19th century with the 1867 beginning of this Marquess of Queens berry Rules.', '2022-07-14 21:26:18', '2022-07-14 21:26:18');
